import React, { ReactNode, FunctionComponent } from 'react'

type Props = {
  children?: ReactNode
}

const Container: FunctionComponent = ({ children }: Props) => {
  return <div style={{ width: '96%', maxWidth: '960px', margin: 'auto' }}>{children}</div>
}

export default Container
